INSERT INTO MUSIKARIA (IzenArtistikoa, Irudia, Ezaugarria, Deskribapena) VALUES
('Rosalía', FROM_BASE64(''), 'Bakarlaria','Rosalía Vila Tobella, Rosalía bezalako kantari, abeslari eta aktore gisa ezaguna da. 1992ko irailaren 25ean jaio zen Sant Esteve Sesrovires, Espainia.'),
('Bad Bunny', FROM_BASE64(''), 'Bakarlaria', 'Benito Antonio Martínez Ocasio, Bad Bunny bezala ezaguna, Puerto Rico-ko kantari eta raperoa da. 1994ko martxoaren 10ean jaio zen San Juan, Puerto Rico.'),
('J Balvin', FROM_BASE64(''), 'Bakarlaria', 'José Álvaro Osorio Balvín, J Balvin bezala ezaguna, Kolonbiako kantari eta abeslari bat da. 1985eko maiatzaren 7an jaio zen Medellín, Kolonbia.'),
('Harry Styles', FROM_BASE64(''), 'Bakarlaria','Harry Edward Styles, Harry Styles bezala ezaguna, Britainiar kantari, abeslari eta aktorea da. 1994ko otsailaren 1ean jaio zen Redditch-en, Erresuma Batua.'),
('Taylor Swift', FROM_BASE64(''), 'Bakarlaria', 'Taylor Alison Swift, Taylor Swift bezala ezaguna, Estatu Batuetako kantari, abeslari eta aktorea da. 1989ko abenduaren 13an jaio zen Reading-en, Pensilvania, Estatu Batuak.'),
('Maluma', FROM_BASE64(''), 'Bakarlaria','Juan Luis Londoño Arias, Maluma bezala ezaguna, Kolonbiako kantari eta abeslari bat da. 1994ko urtarrilaren 28an jaio zen Medellín, Kolonbia.'),
('Imagine Dragons', FROM_BASE64(''), 'Taldea', 'Imagine Dragons, pop rockeko Estatu Batuetako taldea da. Berezko taldea Las Vegas, Nevadan sortua zen 2008an. Dan Reynolds, Wayne Sermon, Ben McKee eta Daniel Platzman osatzen dute.'),
('Maroon 5', FROM_BASE64(''), 'Taldea','Maroon 5, pop rockeko Estatu Batuetako taldea da. Berezko taldea Los Angeles, Kalifornian sortua zen 1994an. Adam Levine, Jesse Carmichael, Mickey Madden eta Ryan Dusick osatzen dute.'),
('Coldplay', FROM_BASE64(''), 'Taldea','Coldplay, pop rockeko Britainiar taldea da. Berezko taldea Londresen sortua zen 1996an. Taldeko kideak Chris Martin, Jonny Buckland, Guy Berryman eta Will Champion dira. Coldplay-ren musika estilo asko daude, batik bat rock alternatibo eta pop rocka, baina baita elektronika eta post-rocka ere. Taldeak mundu mailako fama lortu du bere abesti askatzen dituen album eta kantabiletan oinarrituta.');
INSERT INTO PODCASTER (IzenArtistikoa, Irudia,Deskribapena) VALUES
('Jordi Wild', "", "Jordi Wild espainiar sortzaile ospetsua da, YouTube bezalako plataformetan duen presentziagatik ezaguna. Edukiak gai sorta zabala biltzen du, umoretik hasi eta bidaia eta esperientzia pertsonaletaraino."),
('Delox', "", "Sergio, Delox izenez ere ezaguna, bere karismagatik, ikuspegi positiboagatik eta bere esperientzia pertsonalen eta fitness eta osasunari eskainitako dedikazioaren bidez entzuleak motibatzeko duen gaitasunagatik nabarmentzen da.");
